%pig
business = LOAD 'hdfs://dumbo/user/ddp337/business.json' USING com.twitter.elephantbird.pig.load.JsonLoader('-nestedLoad') as (row:map[]);
review = LOAD 'hdfs://dumbo/user/ddp337/review.json' USING com.twitter.elephantbird.pig.load.JsonLoader('-nestedLoad') as (row:map[]);
user = LOAD 'hdfs://dumbo/user/ddp337/user.json' USING com.twitter.elephantbird.pig.load.JsonLoader('-nestedLoad') as (row:map[]);

%pig
business_required = FOREACH business generate FLATTEN(row#'categories') as categories,row#'name' AS name,row#'business_id' AS business_id ,row#'city' AS city, row#'latitude' AS latitude, row#'longitude' AS longitude,ACOS(SIN(55.9469753*3.14159/180)*SIN((row#'latitude')*3.14159/180)+COS(55.9469753*3.14159/180)*COS((row#'latitude')*3.14159/180)*COS(-3.2096308*3.14159/180 - (row#'longitude')*3.14159/180))*6371 as distance;
business_required = FILTER business_required BY distance <=15;

review_required = FOREACH review GENERATE row#'business_id' AS business_id, (float)row#'stars' AS stars,row#'user_id' AS user_id;

user_required = FOREACH user GENERATE row#'name' as user_name,row#'user_id' as user_id;

%pig
business_plus_review = JOIN business_required BY business_id, review_required BY business_id;
business_plus_review_group = GROUP business_plus_review BY user_id;
business_plus_review_group = FOREACH business_plus_review_group GENERATE FLATTEN(group) AS user_id,AVG(business_plus_review.stars),COUNT(business_plus_review) AS total_reviews;
sorted_reviewers = ORDER business_plus_review_group BY total_reviews DESC;

%pig
top_10_reviewers = LIMIT sorted_reviewers 10;
top_10_reviewers_categories = JOIN top_10_reviewers BY user_id, business_plus_review BY user_id;
top_10_reviewers_categories = FOREACH top_10_reviewers_categories GENERATE $0..$11;
top_10 = GROUP top_10_reviewers_categories BY (user_id,categories);
top_10 = FOREACH top_10 GENERATE FLATTEN(group) AS (user_id,categories),AVG(top_10_reviewers_categories.stars) as average_stars;

%pig
top_10 = JOIN top_10 BY user_id,user_required by user_id;
top_10 = FOREACH top_10 GENERATE user_name, categories, average_stars ;
DUMP top_10;
